INSERT INTO `inbound_data_request` VALUES ('2013-11-04','Teacher qualifications','Carolyn Newberry-Schwartz','Collaboration for Early Childhood','cnewberry@collab4kids.org','708-613-6122','2014-12-31','Percent of teachers and directors in Oak Park and River Forest early childhood programs who have above minimum state educational requirements for their role. Percent of teachers and child care providers who have more than the state mandated 15 documented hours of continuing professional development each year.','The Collaboration works to increase the professional qualifications and skills of early care and education teachers and family child care providers through participation in professional development activities, college-level classes, and statewide quality enhancement initiatives like Great START, Quality Rating System and Gateways to Opportunity. The Collaboration fosters professional communities through its Directors Round Table and Family Child Care Provider Round Table.',NULL,'ISBE teacher accreditation data','\0',4,8,NULL,'Accepted - In Progress',NULL,'Request was sent to ISBE on 1-1-2012',NULL,NULL,NULL,NULL,'chapin','chapin','',1);
